    data: |
      SELECT ALL col0 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT col0 NOT BETWEEN + col2 * - col0 + + col1 / - + 99 AND + col0;
  - name: tab2

outputs:
  - name: q5308.out
    data: |
      46
      64
      75
